import React,{Components} from 'react';
//mport Fitbit from './fitbit';
import classes from'./App.module.css';

function App() {

  const  logo_src="png/fit_band_pink.png";


  return (


    <div className={classes.AppHeader} >
      <header className={classes.mainHeader}>
          <nav className={classes.Topbar}>

                <img src={logo_src}  className={classes.logo} />
                <span className={classes.logo_text}>GearOS</span>
                <button type="button" className={classes.loginBtn}>Login</button>

          </nav>
      </header>
      <div className={classes.mainDiv}>
          <section className={classes.ImageSection}>
          <img src={logo_src}  className={classes.Image} />

          </section>
          <section className={classes.contentSection}>
          <h3 className={classes.headerText} >Gear OS 2-Works on Android and iPhone</h3>
          <p className={classes.paraText} >Wear OS by Gogle works with phones running Android 6.0+ (excluding Go edition) or iOS 10.0+</p>
					<p className={classes.colorText} >Select color</p> 

          <span className={classes.colorText}>

						<span  className={classes.black }></span>
						<span  className={classes.color }></span>
						<span  className={classes.color, classes.black}></span>
						<span  className={classes.color, classes.orange}></span>
					</span>

          </section>

      </div>
    </div>

  );
}

export default App;
